import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';

ReactDOM.render(<App />, document.getElementById('root'));
var editor = CodeMirror.fromTextArea(
  document.getElementById('codemirror_input'),
  {
    mode: 'xml',
    theme: 'dracula',
    lineNumbers: true
  }
);
